import React from 'react'; // React
import Modal, { ModalFooter, ModalTransition, ModalHeader } from '@atlaskit/modal-dialog'; // Atlaskit Modal
import styles from 'styles/components/Modal.module.css'; // Component styles
import Button from '@atlaskit/button';

// const styles = {
//   cancelButton: {
//     backgroundColor: '#ffffff',
//     color: 'blue',
//     border: '4px solid black',
//   },
// };

export default function DancefestModal({
  children,
  heading = 'heading',
  open = true,
  cancelText = 'Cancel',
  submitText = 'Submit',
}) {
  const Header = props => {
    return (
      <ModalHeader className={styles.modal__header} {...props}>
        <h1 className={styles.modal__header_title}>{heading}</h1>
      </ModalHeader>
    );
  };
  const Footer = props => {
    return (
      <ModalFooter className={styles.modal__footer} {...props}>
        <span className={styles.modal__footer_cancelButton}>
          <Button>{cancelText}</Button>
        </span>
        <span className={styles.modal__footer_submitButton}>
          <Button>{submitText}</Button>
        </span>
      </ModalFooter>
    );
  };

  return (
    <ModalTransition>
      {open && (
        <Modal
          components={{
            Header,
            Footer,
          }}
        >
          Modal asdf
          {children}
        </Modal>
      )}
    </ModalTransition>
  );
}
